@chucknorris is boiling hot in this original painting currently on display and available at @galleries1988! 
Go check out what’s available there using the link in my bio! Prints and real paintings are there and painted by real human hands. No typed prompts by me. I can actually paint!
#traditionalart #acrylicpainting #chucknorris #gouachepainting #walkertexasranger #originalart

Looking forward to tonight’s finale. Loved playing the games and love this show. I’m going to have to pick up that remake now. I tried a couple new paints @turnercolourworks from my friends at @jerrysartarama. Anyone else try their Japanese colors? The deep pink and red worked pretty well. The Pink was very desaturated and opaque while the red behaved similarly to a cad red medium. Let me know what you think in the comments about the show and the paint!

